Тренажер для тренировки выравнивания давления или отовент DEEPDIVE — приспособления, с помощью которых удобно тренировать продувку.
Можно использовать их с шариками, и тогда это весело и наглядно (шары прилагаются), а можно и без, и тогда это просто полезно.
созданы из высококачественного ABS-пластика;
изготовлены методом 3D-печати;
воздушные шарики прилагаются (цвета шариков могут быть разными)
Тренажер для тренировки выравнивания давления DEEPDIVE — сделают вашу барабанную перепонку эластичной и сговорчивой!

Маска прекрасно подходит и для фридайвинга.
Двухлинзовый низкопрофильный дизайн – экстремально малый объем подмасочного пространства;
Гипоалергенный силикон – великолепное прилегание и никакого раздражения кожи;
Карданные пряжки;
Широкий комфортный ремешок.

Характеристики:
- рекомендации по применению: фридайвинг, подводная охота, снорклинг;
- количество стекол: двухстекольная;
- возможность установки корректирующих линз (диоптрий): нет;
- покрытие стекла: нет;
- безрамочная технология: да;
- крепление для GoPro: нет;
- материал иллюминатора: закалённое стекло;
- материал обтюратора: силикон;
- материал рамки: нет;
- габариты, Д*Ш*В, мм: 137*55*100;
- подмасочный объем, см3: 95;
- площадь линз, см2: 36;
- вес, грамм: 140;
- цвет: черный, белый, серый, красный, черно-белый, черно-красный;
- пол: унисекс;
- бокс для хранения: нет, пластиковый бокс идет к моделям PIRATE, FIRESTONE;
- бренд: C4 CARBON;
- страна бренда: Италия;
- страна производства: Китай.

