Огромная вместительность - в рюкзак с легкостью помещается крупный инвентарь, такой как доски для плавания, колобашки или ласты;
Большие боковые карманы с вентиляцией - позволяют без труда отделить мокрые вещи от сухих;
Отсек для обуви - в нижний вентилируемый отсек рюкзака Mad Team помещается до 2-х пар обуви или даже пара коротких тренировочных ласт;
Карабин - многофункциональный карабин позволит с легкостью закрепить рюкзак на вешалке.
